import styles from './BrandItem.module.scss'

interface IBrandItem {
    value: {}
}

export default function BrandItem(props: IBrandItem) {
    return (
        <div className={styles['brandItem']}>
            <div className={styles['brandItem-header']}>
                <div className={styles['brandItem-title']}></div>
                <div className={styles['brandItem-timer']}></div>
            </div>
            <div className={styles['brandItem-body']}>
                <div className={styles['brandItem-id']}></div>
                <div className={styles['brandItem-apiKeys']}>
                    <span className={styles['apiKeys_One']}></span>
                    <span className={styles['apiKeys_Two']}></span>
                </div>
                <div className={styles['brandItem-updateTime']}></div>
            </div>
        </div>
    )
}
